import React from "react";
import styled from "styled-components";
import Aside from "../Aside/Aside";
import Swipe from "./components/Main/RightSection/Swipe";
const Main = styled.main`
  width: 870px;
`;
const AsideSectionWrapper = styled.div`
  display: flex;
`;

const MainComponent = () => {
  return (
    <Main>
      <AsideSectionWrapper>
        <Aside />
        <Swipe />
      </AsideSectionWrapper>
    </Main>
  );
};

export default MainComponent;
